import './App.css';
import { getWeatherApi } from 'src\api\weather.js'
import { useEffect } from 'react';

function App() {
  const [weather, setweather] = useState([]);

  useEffect(() => {
    getWeatherApi()
      .then(weather => setweather(weather));
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello world</h1>
        <p>{weather.map}</p>
      </header>
    </div>
  );
}

export default App;
